import React from 'react';



class Button extends React.Component {

  render() {
    return(
      <div>
      <img src="" alt="THIS IS TOTALLY AN IMAGE" />
      <Button variant="primary"> Primary </Button>
      </div>
    );

  }

}

export default Button;
